        <h1 className="edificio-crud-form-title">Dados do Edificio</h1>

        <form action="">
            <div className="row">
              <div className="col-lg-6">
                <input type="text" />
                <input type="text" />
                <input type="text" />
         
              </div>
              <div className="col-lg-6">
                <textarea name="" rows={10}></textarea>

              </div>
            </div>
        </form>
      </div>
    </div>
  );
};

export default Form;
